import React from "react";
import { Menu } from 'semantic-ui-react'

const NavBar = props => {
  return (
    <Menu inverted>
          <Menu.Item
            name='Super Duper Fun Time Trivia App 2000'
            onClick={this.handleItemClick} />
          <Menu.Item
            className="right aligned"
            name='🏆'
            onClick={this.handleItemClick} />
    </Menu>

  )
}

export default NavBar;
